import "./HomePage.scss";
import vegiterian from "../../../assets/vegiterian-icon.png";
import spicy from "../../../assets/group-2.png";
import vegan from "../../../assets/vegan-icon.png";
import GreyCard from "../../layout/card/GreyCard";
import '../../DummyData';

const Icons = () => {
  return (
    <GreyCard>
      <p> THE MEANING OF OUR ICONS :</p>
      <div className="icons-container">
        <div>
          <img src={spicy} alt="icon"></img>Spicy
        </div>
        <div>
          <img src={vegiterian} alt="icon"></img>Vegitarian
        </div>
        <div>
          <img src={vegan} alt="icon" className="vegan-icon"></img>Vegan
        </div>
      </div>
    </GreyCard>
  );
};

export default Icons;
